import '..../App.css';
import { Component } from "react";
import SignUp from '../SingUp';
import Login from '../Login';

class LoginSingUp extends Component {
    render() {
        return (
            <div>
                <Login />
                <SignUp />
            </div>
        )

    }

}

export default LoginSingUp;
